p.x:
var $bm_rt;
var pos;
pos = value;
pos[0] = $bm_sub(pos[0], $bm_mul(1.3, timeToFrames($bm_sub(time, inPoint), $bm_div(1, thisComp.frameDuration), true)));
$bm_rt = pos;

s.x:
var $bm_rt;
var n, n, t, t, v, amp, freq, decay;
$bm_rt = n = 0;
if (numKeys > 0) {
    $bm_rt = n = nearestKey(time).index;
    if (key(n).time > time) {
        n--;
    }
}
if (n == 0) {
    $bm_rt = t = 0;
} else {
    $bm_rt = t = $bm_sub(time, key(n).time);
}
if (n > 0) {
    v = velocityAtTime($bm_sub(key(n).time, $bm_div(thisComp.frameDuration, 10)));
    amp = effect('DISTANCE S')('Slider');
    freq = effect('FREQUENCY S')('Slider');
    decay = effect('DECAY S')('Slider');
    $bm_rt = $bm_sum(value, $bm_div($bm_mul($bm_mul(v, amp), Math.sin($bm_mul($bm_mul($bm_mul(freq, t), 2), Math.PI))), Math.exp($bm_mul(decay, t))));
} else {
    $bm_rt = value;
}
